import axios from './apiConfig'
const proxy1 = '/api'
export default {
	userLogin:(data,selfCb)=>axios(proxy1+'/user/login', "POST", data, null, selfCb),
	userRegister:(data,selfCb)=>axios(proxy1+'/user/registerAccount', "POST", data, null,selfCb),
}
